@AndroidEntryPoint
class ExpressionFragment : BaseFragment<FragmentExpressionBinding>(R.layout.fragment_expression) {
    private val viewModel by viewModels<ExpressionViewModel>()

    override fun init() {
        binding.chart.setData(ExpressionScore(70, 30, 50, 60, 70, 40))
        Timber.e("init")
        compositeDisposable.add(
            Observable.fromCallable {}
                .subscribeOn(Schedulers.io()) // report or post the result to main thread.
                .observeOn(AndroidSchedulers.mainThread()) // execute this RxJava
                .subscribe({
                    setHeatMap()
                }, {}, {})
        )
    }

    private fun setHeatMap() {
        binding.heatMap.forceRefresh()
        binding.heatMap.setMinimum(0.0)
        binding.heatMap.setMaximum(130.0)
        binding.heatMap.setRadius(150.0)
        binding.heatMap.setMaxDrawingWidth(400)
//        binding.heatMap.setMinimum(0.0)
//        binding.heatMap.setMaximum(250.0)
//        binding.heatMap.setRadius(250.0)
//        binding.heatMap.setMaxDrawingWidth(400)

        val gson = Gson()
        val list = gson.fromJson<MutableList<MutableList<Float>>>(
            data,
            object : TypeToken<MutableList<MutableList<Float>>>() {}.type
        )
        for (i in list.indices) {
            val mark = list[i]
            val x = mark[0]
            val y = mark[1]
            val heatX = x / 480
            val heatY = y / 640
            val point = HeatMap.DataPoint(heatX, heatY, 20.0)
            binding.heatMap.addData(point)
        }

        //make the colour gradient from pink to yellow
        val colorStops: MutableMap<Float, Int> = ArrayMap()
        colorStops[0.0f] = -0x848101
        colorStops[0.25f] = -0x990001
        colorStops[0.5f] = -0x7f119c
        colorStops[0.75f] = -0x3cb3
        colorStops[1.0f] = -0xfd00
        binding.heatMap.setColorStops(colorStops)
        Timber.e("size : ${list.size}")

        val gradientDrawable = GradientDrawable(
            GradientDrawable.Orientation.RIGHT_LEFT, intArrayOf(
                ContextCompat.getColor(requireContext(), R.color.heat_map_1),
                ContextCompat.getColor(requireContext(), R.color.heat_map_2),
                ContextCompat.getColor(requireContext(), R.color.heat_map_3),
                ContextCompat.getColor(requireContext(), R.color.heat_map_4),
                ContextCompat.getColor(requireContext(), R.color.heat_map_5)
            )
        )
        binding.ivGradation.setImageDrawable(gradientDrawable)
    }

